import React from 'react';
import {
    BrowserRouter as BRouter,
    Switch,
    Route
} from 'react-router-dom';

import Search from './pages/search';

const Routes = () => (
    <BRouter>
        <Switch>
            <Route path="/" exact component={ Search } />
        </Switch>
    </BRouter>
);

export default Routes;
